import * as React from 'react';

interface DashboardStats {
  totalMessages: number;
  highPriority: number;
  pendingReplies: number;
}

export const Dashboard: React.FC = () => {
  const stats: DashboardStats = {
    totalMessages: 24,
    highPriority: 8,
    pendingReplies: 12
  };

  const priorityTasks = [
    {
      id: '1',
      title: 'Q1 Report Review',
      urgent: true
    }
    // Add more tasks as needed
  ];

  return (
    <div className="dashboard-container">
      {/* Daily Summary Section */}
      <section className="dashboard-section">
        <div className="section-header">
          <span className="section-icon">📚</span>
          <h2>Daily Summary</h2>
        </div>

        <div className="stats-grid">
          <div className="stat-item">
            <label>Total Messages</label>
            <span className="stat-value">{stats.totalMessages}</span>
          </div>
          <div className="stat-item">
            <label>High Priority</label>
            <span className="stat-value high-priority">{stats.highPriority}</span>
          </div>
          <div className="stat-item">
            <label>Pending Replies</label>
            <span className="stat-value pending">{stats.pendingReplies}</span>
          </div>
        </div>

        <button className="generate-report-button">
          Generate Detailed Report
        </button>
      </section>

      {/* Priority Tasks Section */}
      <section className="dashboard-section">
        <div className="section-header">
          <span className="section-icon">🎯</span>
          <h2>Priority Tasks</h2>
        </div>

        <div className="tasks-list">
          {priorityTasks.map(task => (
            <div key={task.id} className="task-item">
              <div className="task-content">
                <h3>{task.title}</h3>
                {task.urgent && (
                  <span className="urgent-badge">
                    <span role="img" aria-label="urgent">⚠️</span>
                    Urgent
                  </span>
                )}
              </div>
              <button className="task-action">
                <span role="img" aria-label="view">👉</span>
              </button>
            </div>
          ))}
        </div>
      </section>
    </div>
  );
};
